import React, { useState } from "react";

function App() {
  const [count, setCount] = useState(null);
  const [boxes, setBoxes] = useState([]);

  const handleDetect = async () => {
    try {
      const response = await fetch("http://localhost:8000/api/v1/detect-live");
      const data = await response.json();
      setCount(data.count);
      setBoxes(data.boxes || []);
    } catch (error) {
      console.error("–û—à–∏–±–∫–∞ –ø—Ä–∏ –ø–æ–ª—É—á–µ–Ω–∏–∏ –¥–∞–Ω–Ω—ã—Ö:", error);
    }
  };

  return (
    <div style={{ padding: "2rem", fontFamily: "Arial, sans-serif" }}>
      <h1>YOLO Student Counter</h1>
      <button onClick={handleDetect}>Detect Live from Camera</button>

      {count !== null && (
        <div style={{ marginTop: "1rem" }}>
          <h2>üßç Detected students: {count}</h2>
        </div>
      )}

      {boxes.length > 0 && (
        <pre style={{ background: "#f3f3f3", padding: "1rem" }}>
          {JSON.stringify(boxes, null, 2)}
        </pre>
      )}
    </div>
  );
}

export default App;
